import React from "react";
import { useHistory } from 'react-router-dom';
import './Header.css';
function Header(props){
    const username = sessionStorage.getItem("username");
    //const userID = sessionStorage.getItem("userID");
    const history = useHistory();
    const navigateTo = () =>{
        history.push("/Cart");
    }
    return(
        <>
            <nav className="navbar navbar-inverse">
                <div className="container-fluid">
                     <div className="navbar-header">
                         <a href="#" className="navbar-brand title">MedApp</a>
                     </div>
                    <ul className="nav navbar-nav navbar-right">
                       <li><a href="#" className="list" onClick={() =>navigateTo()}><i className="fa fa-shopping-cart" /> your cart ({props.data.length}) </a></li>
                       <li><a className="list"><span className="glyphicon glyphicon-user"></span>Hi, {username}</a></li>
                    </ul>
                </div>
            </nav>
        </>
    )
}
export default Header
